Here's an example Python function that uses dynamic programming to find the longest common subsequence (LCS) between two input strings:

```python
def lcs(str1, str2):
    # Create a 2D matrix to store the lengths of LCS
    dp = [[0] * (len(str2) + 1) for _ in range(len(str1) + 1)]

    # Compute the length of LCS using dynamic programming
    for i in range(1, len(str1) + 1):
        for j in range(1, len(str2) + 1):
            if str1[i-1] == str2[j-1]:
                dp[i][j] = dp[i-1][j-1] + 1
            else:
                dp[i][j] = max(dp[i-1][j], dp[i][j-1])

    # Build the LCS by backtracking through the matrix
    lcs_str = []
    i, j = len(str1), len(str2)
    while i > 0 and j > 0:
        if str1[i-1] == str2[j-1]:
            lcs_str.append(str1[i-1])
            i -= 1
            j -= 1
        elif dp[i-1][j] > dp[i][j-1]:
            i -= 1
        else:
            j -= 1

    return ''.join(reversed(lcs_str))
